import './index.css'

function ShowCartList(props){
    return(
        <>
            <div className='cart-div'>
                <p>Your cart</p>
                {props.quant > 0 ?
                 <p>...</p> :
                  <p>You dont have any item on your cart.</p>}
            </div>
        </>
    )
}

export default ShowCartList;
